        },
      ],
  },

  {
    title: 'MSCS-MIS',
    submenu: [
      {
        title: 'New User Registration',
        url: 'Register',
      },
      {
      title: 'User Login',
      url: 'login',
      },
      {
      title: 'Appeal',
      url: 'AppealForm',
      },
      ],
  },


  {
    title: 'Liquidation',
    submenu: [
